using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Problems.Advent._2018
{
    public class Dag5 : Problem
    {
        private const string input = 
            "";

        private const string alfabet = "abcdefghijklmnopqrstuvwxyz";

        public override Task ExecuteAsync()
        {
            int length = 100000;
            for (int i = 0; i < 26; i++)
            {
                string s = input.Replace(alfabet[i].ToString(),"").Replace(alfabet[i].ToString().ToUpper(),"");
                string newS = Step(s);
                while (s != newS)
                {
                    s = newS;
                    newS = Step(s);
                }

                if (s.Length < length)
                {
                    length = s.Length;
                }
            }

            Result = length.ToString();
            return Task.CompletedTask;
        }

        private string Step(string s)
        {
            StringBuilder sb = new StringBuilder();
            for (int i = 0; i < s.Length-1; i++)
            {
                if(s[i] != s[i+1] && s[i].ToString().ToUpper() == s[i+1].ToString().ToUpper())
                {
                    i++;
                }
                else
                {
                    sb.Append(s[i]);
                }
                if (i == s.Length - 2)
                {
                    sb.Append(s.Last());
                }
            }
            return sb.ToString();
        }

        public override int Nummer => 201805;
    }
}
